  const [customerDetails, setCustomerDetails] = useState([]); // Changed from 'this.state.customerDetails' to a state variable


  function App() {

    return (

    <BrowserRouter>

    <div className="App">

      <div className="displayflex">

      <Link to="/Customer"><button className='button1'><b>Customer</b></button></Link> &nbsp; &nbsp; &nbsp; &nbsp;

      <Link to="/Catalogue"><button className='button1'><b>Catalogue</b></button></Link> &nbsp; &nbsp; &nbsp; &nbsp;

      <Link to="/OrderDetails"><button className='button1'><b>OrderDetails</b></button></Link> &nbsp; &nbsp; &nbsp; &nbsp;

      </div>

    </div>

    <Routes>

      <Route path="/Customer" element={<Customer formData={formData} setFormData={setFormData} customerDetails={customerDetails}/>}/>

      <Route path="/Catalogue" element={<Catalogue/>}/>

      <Route path="/OrderDetails" element={<OrderDetails/>}/>

    </Routes>

    </BrowserRouter>

  );

}

export default App;
